Австралийскую битву россиянок выиграла Елена Дементьева

Серебряная призерка Олимпиады в Сиднее, похоже, находится в неплохой форме. Во всяком случае она уже повторила свой прошлогодний успех, добравшись до третьего круга Открытого первенства Австралии. Победа над соотечественницей Анастасией Мыскиной далась ей довольно легко - 6:4, 6:2, на что ушло 1 час 14 минут.

Сеянная 12-й Дементьева хуже справлялась с прямыми ударами: 14 выигранных против 16 у Мыскиной, - однако на задней линии она была лучше и к тому же часто ловила соперницу неожиданными ударами против хода соперницы. Следующей соперницей Елены станет победительница матча между Маги Серной и Мари Эленой Камерин.

